import { useEffect, useState } from 'react';

export default function CRON(props) {
  const [cronState, setCronState] = useState(null);

  useEffect(()=>{
    fetch("https://www.aaronbae.com/api/monitor/cron").then(res=>res.json())
    .then(cron => {
      setCronState(cron)
    })
  },[])

  return (
    <div className={`card-wrapper ${props.className}`}>
      CRON
      {cronState}
    </div>
  )
}
